pragma solidity ^0.5.12;

contract VSElection {
    struct Candidate {
        string name;
        uint voteCount;
        bool isLoser;
        bool isEliminated;
    }

    struct Voter {
        bool hasVoted;
        uint voteIndex;
        uint weight;
    }

    address public owner;
    string public name;
    mapping(address => Voter) public voters;
    address [] votersAddress;
    Candidate[] public candidates;
    Candidate[] public bracket;
    Candidate winner;

    //uint public auctionEnd;
    bool isFinished;
    uint roundCount = 0;

    event VSElectionResult(string name, uint voteCount);

    constructor (/*string memory _name, uint durationMinute*/) public {
        owner =  msg.sender;
        name = "winner";
        //auctionEnd = now + (durationMinute * 1 minutes);
    }

    function populateCandidates() private {
        candidates.push(Candidate("michel", 0, false, false));
        candidates.push(Candidate("bichel", 0, false, false));
        candidates.push(Candidate("yichel", 0, false, false));
        //candidates.push(Candidate("tichel", 0, false, false));
    }

    function addCandidate(string memory _name) public {
        require(msg.sender == owner);
        candidates.push(Candidate(_name, 0, false, false));
    }

    function populateAuthorization() private {
        authorize(0xCA35b7d915458EF540aDe6068dFe2F44E8fa733c);
        authorize(0x14723A09ACff6D2A60DcdF7aA4AFf308FDDC160C);
        authorize(0x4B0897b0513fdC7C541B6d9D7E929C4e5364D2dB);
        authorize(0x583031D1113aD414F02576BD6afaBfb302140225);
        authorize(0xdD870fA1b7C4700F2BD7f44238821C26f7392148);
    }

    function authorize(address voter) public {
        require(msg.sender == owner);
        require(!voters[voter].hasVoted);

        votersAddress.push(voter);
        voters[voter].weight = 1;
    }

    function vote(uint voteIndex) public {
        /*require(now < auctionEnd);*/
        require(!voters[msg.sender].hasVoted);
        require(voters[msg.sender].weight >= 1);
        require(!isFinished);

        voters[msg.sender].hasVoted = true;
        voters[msg.sender].voteIndex = voteIndex;

        candidates[voteIndex].voteCount += voters[msg.sender].weight;
    }

    function end() public {
        require(msg.sender == owner);
        //require(now >= auctionEnd);

        isFinished = true;
        sortBracket();
        newRound();
    }

    function startElection() public {
        populateCandidates();
        populateAuthorization();
        require(candidates.length >= 2);
        newRound();
    }

    function checkWinner() private returns(bool) {
        uint winnerCount = 0;
        uint looserCount = 0;
        for(uint i = 0; i < candidates.length; i++) {
            if(!candidates[i].isEliminated) {
                if(!candidates[i].isLoser) {
                    winner = candidates[i];
                    winnerCount++;
                } else {
                    looserCount++;
                }
            }
        }

        //TODO: rparer la condition
        if(looserCount <= 1 && winnerCount == 1)
        return true;
        else
        return false;
    }

    function resetVoters() private {
        for(uint i = 0; i < votersAddress.length; i++) {
            voters[votersAddress[i]].hasVoted = false;
        }
    }

    function newRound() private {
        if(!checkWinner()) {
            resetVoters();
            isFinished = false;
            setBracketLosers();
            if(bracket.length != 2) {
                setBracketWinners();
            }
        }
    }

    function setBracketLosers() private {
        name = "looser";
        delete bracket;
        for(uint i = 0; i < candidates.length; i++) {
            if(candidates[i].isLoser && !candidates[i].isEliminated)
                bracket.push(candidates[i]);
        }
    }

    function setBracketWinners() private {
        name = "winner";
        delete bracket;
        for(uint i = 0; i < candidates.length; i++) {
            if(!candidates[i].isLoser && !candidates[i].isEliminated)
                bracket.push(candidates[i]);
        }
    }

    function sortBracket() private {
        require(isFinished);

        Candidate memory temp;
        for(uint i = 0; i < bracket.length; i++) {
            for(uint j = i+1; j < bracket.length; j++) {
                if(bracket[i].voteCount < bracket[j].voteCount) {
                    temp = bracket[i];
                    bracket[i] = bracket[j];
                    bracket[j] = temp;
                }
            }
        }

        uint firstIndex;
        uint lastIndex;
        for(uint i = 0; i < candidates.length; i++) {
            candidates[i].voteCount = 0;
            if(compareStrings(candidates[i].name, bracket[0].name)) {
                firstIndex = i;
            }

            if(compareStrings(candidates[i].name, bracket[bracket.length - 1].name)) {
                lastIndex = i;
            }
        }

        if(candidates[lastIndex].isLoser) {
            candidates[lastIndex].isEliminated = true;
            candidates[firstIndex].isLoser = false;
        } else {
            candidates[lastIndex].isLoser = true;
        }
    }

    function compareStrings (string memory a, string memory b) private pure returns (bool) {
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))) );
    }
}
